//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

//import "hardhat/console.sol";

contract DurianSupplyChain {
    struct Durian {
        //Owner
        address owner;
        //Format : D0001
        //string durianid;
        uint8 tree;
        string types;
        uint16 price;
        //Gram
        uint16 weight;
        uint256 harvestDate;
        //string state;
        //Farm
        address farmid;
        //Distribution Center
        //Format : C0001
        address centerid;
        uint256 distributeDate;
        string deliveryMethod;
        //Retailer
        address retailer;
        uint256 retailDate;
        //Consumer
        address customer;
        uint256 soldDate;
        //(taste, fragrance, creaminess)
        uint8[3] ratings;
        string comment;
    }

    struct Farm {
        string name;
        string location;
        string[] durian;
        mapping(string => Durian) durianInHand;
    }

    struct Center {
        string name;
        string location;
        string[] durian;
        mapping(string => Durian) durianInHand;
    }

    struct Retail {
        string name;
        string location;
        string[] durian;
        mapping(string => Durian) durianInHand;
    }

    struct Customer {
        string[] durian;
        mapping(string => Durian) durianInHand;
    }

    //participants[] allParticipant;
    mapping(address => Farm) farmAll;
    address[] farmSize;
    mapping(address => Center) centerAll;
    address[] centerSize;
    mapping(address => Retail) retailAll;
    address[] retailSize;
    //String = Part(farm/center/retail)
    mapping(address => string) participantsAll;
    address[] ParticipantSize;
    mapping(address => Customer) customerAll;
    address[] customerSize;
    mapping(string => Durian) durianAll;
    string[] durianSize;

    address payable public buyer;

    uint256 durianN = 1;

    function durianExists(string memory _id) internal view returns (bool) {
        return durianAll[_id].owner != address(0);
    }

    function durianExistsInHand(string memory _id)
        internal
        view
        returns (bool)
    {
        if (farmAll[msg.sender].durianInHand[_id].tree != 0) {
            return true;
        } else if (centerAll[msg.sender].durianInHand[_id].tree != 0) {
            return true;
        } else if (retailAll[msg.sender].durianInHand[_id].tree != 0) {
            return true;
        } else if (customerAll[msg.sender].durianInHand[_id].tree != 0) {
            return true;
        }

        return false;
    }

    function addParticipant(
        address _add,
        string memory _part,
        string memory _name,
        string memory _loc
    ) public {
        //require(!addressExists(_add), "Address exist in participant");
        // require(
        //     keccak256(bytes(_part)) == keccak256(bytes("farm")) ||
        //         keccak256(bytes(_part)) == keccak256(bytes("center")) ||
        //         keccak256(bytes(_part)) == keccak256(bytes("retail")),
        //     "Invalid participant type"
        // );
        if (keccak256(bytes(_part)) == keccak256(bytes("farm"))) {
            participantsAll[_add] = "farm";
            farmSize.push(_add);
            farmAll[_add].name = _name;
            farmAll[_add].location = _loc;
            //console.log("Farm Added");
        } else if (keccak256(bytes(_part)) == keccak256(bytes("center"))) {
            participantsAll[_add] = "center";
            centerSize.push(_add);
            centerAll[_add].name = _name;
            centerAll[_add].location = _loc;
            //console.log("Center Added");
        } else if (keccak256(bytes(_part)) == keccak256(bytes("retail"))) {
            participantsAll[_add] = "retail";
            retailSize.push(_add);
            retailAll[_add].name = _name;
            retailAll[_add].location = _loc;
            //console.log("Retail Added");
        } else if (keccak256(bytes(_part)) == keccak256(bytes("customer"))) {
            participantsAll[_add] = "customer";
            customerSize.push(_add);
            //console.log("Customer Added");
        }
        ParticipantSize.push(_add);
        //console.log("Participant Added");
    }

    function getAllFarms() public view returns (address[] memory) {
        return farmSize;
    }

    function getAllCenter() public view returns (address[] memory) {
        return centerSize;
    }

    function getAllRetailer() public view returns (address[] memory) {
        return retailSize;
    }

    function harvestDurian(
        uint8 _tree,
        string memory _types,
        uint16 _weight,
        uint16 _price
    ) public {
        ////console.log("Harvesting ......");
        //require(addressExists(msg.sender));
        string memory newid = string.concat("D", (uint2str(durianN)));

        ////console.log("New Durian ID: %s", newid);
        ////console.log("Block timestamp: %s", block.timestamp);
        ////console.log("Farmer address: %s", msg.sender);
        Durian memory d = Durian({
            owner: msg.sender,
            //durianid: newid,
            tree: _tree,
            types: _types,
            price: _price,
            weight: _weight,
            harvestDate: block.timestamp,
            //state: "harvested",
            farmid: msg.sender,
            centerid: address(0),
            distributeDate: 0,
            deliveryMethod: "",
            retailer: address(0),
            retailDate: 0,
            customer: address(0),
            soldDate: 0,
            ratings: [0, 0, 0],
            comment: ""
        });
        farmAll[msg.sender].durianInHand[newid] = d;
        farmAll[msg.sender].durian.push(newid);
        durianSize.push(newid);
        durianN++;
        ////console.log("New durian count: %s", durianN);
    }

    function getAllDuriansByAddress() public view returns (string[] memory) {
        string[] memory result;
        string memory participantType = participantsAll[msg.sender];

        if (bytes(participantType).length == 0) {
            // If the participant type is unknown, return an empty array
            return result;
        } else if (
            keccak256(bytes(participantType)) == keccak256(bytes("farm"))
        ) {
            // If the participant is a farm, return the list of durians in the farm
            Farm storage farm = farmAll[msg.sender];
            result = new string[](farm.durian.length);
            for (uint256 i = 0; i < farm.durian.length; i++) {
                result[i] = farm.durian[i];
            }
        } else if (
            keccak256(bytes(participantType)) == keccak256(bytes("center"))
        ) {
            // If the participant is a distribution center, return the list of durians in the center
            Center storage center = centerAll[msg.sender];
            result = new string[](center.durian.length);
            for (uint256 i = 0; i < center.durian.length; i++) {
                result[i] = center.durian[i];
            }
        } else if (
            keccak256(bytes(participantType)) == keccak256(bytes("retail"))
        ) {
            // If the participant is a retailer, return the list of durians in the retailer
            Retail storage retail = retailAll[msg.sender];
            result = new string[](retail.durian.length);
            for (uint256 i = 0; i < retail.durian.length; i++) {
                result[i] = retail.durian[i];
            }
        } else if (
            keccak256(bytes(participantType)) == keccak256(bytes("customer"))
        ) {
            // If the participant is a customer, return the list of durians in the customer
            Customer storage customer = customerAll[msg.sender];
            result = new string[](customer.durian.length);
            for (uint256 i = 0; i < customer.durian.length; i++) {
                result[i] = customer.durian[i];
            }
        }

        return result;
    }

    function getDurianById(string memory _id)
        internal
        view
        returns (Durian storage)
    {
        return durianAll[_id];
    }

    function getDurianDetail(string memory _id)
        public
        view
        returns (Durian memory)
    {
        require(durianExists(_id), "Durian does not exist");
        Durian memory d = getDurianById(_id);
        ////console.log("id : ", d.durianid);
        ////console.log("farm : ", d.farmid);
        ////console.log("center : ", d.centerid);
        ////console.log("retail : ", d.retailer);
        ////console.log("consumer : ", d.consumer);
        return d;
    }

    function sendToDistribution(
        string memory _id,
        address distributionInfo,
        string memory _delivery
    ) public {
        //require(durianExists(_id), "Durian never exist in the system");
        //require(addressExists(distributionInfo),"Distribution Center does not exist");
