    function buyFromRetailer(string memory _id) public payable {
        //require(durianExists(_id), "Durian never exist in the system");
        //require(durianExistsInHand(_id), "Durian does not exist in retailer");

        Durian storage durian = durianAll[_id];
        Retail storage retailer = retailAll[durian.retailer];

        addParticipant(msg.sender, "customer", "", "");

        // Check that the consumer sends enough ether to pay for the durian
        //require(msg.value >= durian.price, "Insufficient payment");

        // Remove durian from retailer and add it to consumer
        durian.owner = msg.sender;
        durian.customer = msg.sender;
        durian.soldDate = block.timestamp;
        customerAll[msg.sender].durianInHand[_id] = durian;
        customerAll[msg.sender].durian.push(_id);

        
        removeDurianFromList(retailAll[durian.retailer].durian, _id);
        delete retailer.durianInHand[_id];

        // Update durian information in the durians mapping
        durianAll[_id] = durian;
        
        // Send ether to retailer
        buyer = payable(durian.retailer);
        buyer.transfer(msg.value);

        // Refund any extra ether sent by the consumer
        if (msg.value > durian.price) {
            payable(msg.sender).transfer(msg.value - durian.price);
        }
    }

