    function removeDurianFromList(
        string[] storage durianList,
        string memory durianId
    ) internal {
        uint256 index;
        bool found = false;

        // Loop through the array to find the index of the element to remove
        for (uint256 i = 0; i < durianList.length; i++) {
            if (keccak256(bytes(durianList[i])) == keccak256(bytes(durianId))) {
                index = i;
                found = true;
                break;
            }
        }

        // If the element is found, remove it from the array
        if (found) {
            for (uint256 i = index; i < durianList.length - 1; i++) {
                durianList[i] = durianList[i + 1];
            }
            durianList.pop();
        }
    }

    function uint2str(uint256 _i) internal pure returns (string memory) {
        if (_i == 0) {
            return "0";
        }
        uint256 j = _i;
        uint256 len;
        while (j != 0) {
            len++;
            j /= 10;
        }
        bytes memory bstr = new bytes(len);
        uint256 k = len;
        while (_i != 0) {
            k = k - 1;
            uint8 temp = (48 + uint8(_i - (_i / 10) * 10));
            bytes1 b1 = bytes1(temp);
            bstr[k] = b1;
            _i /= 10;
        }
        return string(bstr);
    }
